import * as React from 'react';
import {
    Text,
    View,
    StyleSheet,
    TextInput,
    ImageBackground,
    TouchableOpacity,
    Image,
    ActivityIndicator
} from 'react-native';

import styles from './styles/testScreen.style.js'
const LoadingScreen = () => {
    return (
        <View>
            <Text> This is a loading screen</Text>
        </View>
    );
}

export default LoadingScreen;
